import React from 'react';
import {Image, Menu, Icon, Sidebar } from 'semantic-ui-react';
import cover from '../static/cover.png';

const GraphTypeOptions = {
  'Item1': 'Home',
  'Item2': 'Requests By Types',
  'Item3': 'Requests By Months',
};

class NavigationBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      active: 'Home'
    };
  };

  handleClick(name){
    console.log('clicked')
    console.log(name);
  };

  render() {
    const { activeItem } = this.state.active;
    const Item1 =GraphTypeOptions.Item1;

     return (
       <Sidebar as={Menu} icon='labeled' inverted
              vertical visible={true} width='thin'>
          <Menu.Item 
            name = 'Home' 
            onClick={(e, {name}) => this.handleClick(name)}>
            <Image src = {cover} />
          </Menu.Item>
          <Menu.Item as='a' name = 'Group'>
            <Icon name='group' />
            About Us
          </Menu.Item>
          <Menu.Item as='a' name = ''>
            <Icon name='camera' />
            Officers
          </Menu.Item>
          <Menu.Item as='a'>
            <Icon name='calendar alternate' />
            Events
          </Menu.Item>
          <Menu.Item as='a'>
            <Icon name='camera' />
            Photos
          </Menu.Item>
          <Menu.Item as='a'>
            <Icon name='phone square' />
            Contact Us
          </Menu.Item>
      </Sidebar>
  )};
};

export default NavigationBar;
